// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

contract Casino  {
    address internal owner;

    mapping(string => address[]) internal votersByColor;

    mapping(address => uint) internal playerBetAmounts;

    string public lastWin;
    uint public lastPayoutAmount;

    constructor() {
        owner = msg.sender;
    }

    function vote(string calldata color) external payable {
        require(msg.value >= .015 ether);

        votersByColor[color].push(msg.sender);

        uint betAmount = playerBetAmounts[msg.sender];
        playerBetAmounts[msg.sender] = betAmount + msg.value;
    }

    function pickWinner(string calldata color) external {
        require(msg.sender == owner);

        address[] memory _winners = votersByColor[color];

        for (uint i = 0; i < _winners.length; i++ ) {
            address _winner = _winners[i];
            (bool sent, bytes memory data) = _winner.call{value: playerBetAmounts[_winner]}("");
            require(sent, "Failed to send Ether");
        }
    }

    function getNumberOfVotersByColor(string calldata color) external view returns(uint) {
        return votersByColor[color].length;
    }

    function getLastWin() external view returns(string memory) {
        return lastWin;
    }
}
